 () => {
  const router = useRouter();

  const id = router.query?.id ? takeFirst(router.query.id) : undefined;
  const publicPersonQuery = queries.useGetPublicPerson(id);

  const publicPerson = publicPersonQuery.data?.result;

  return (
    <Div>
      {publicPersonQuery.isLoading ? <FancyLoader /> : null}

      <PublicPersonComponent publicPerson={publicPerson} />
    </Div>
  );
}
